  //         return deity.name.toLowerCase() === search.toLowerCase()
  //         })
  //         setDeity(filteredDeity)
  //     }

  <div className="deities">
    {deity.map((deity, index) => {
        return (
            <div key={index}>
                <h1>Name: {deity.name}</h1>
                </div>
        )
    })}
  </div>
};

export default Deity;
